import React from 'react';
import './App.css';
import Articles from 'src/screens/Articles.js';
import ShoppingCart from '/src/screens/ShoppingCart.js';
import {BrowserRouter as Route, Switch, Link} from '';

function App() {
  return (
    <div id="wrapper">
      <div id="main">
      <Switch>
        <Route path='/' exact component={Articles}/>
        <Route path='shoppingcart' component={ShoppingCart}/>
      </Switch>
      </div>
  </div>

  );
}

export default App;
